import React from 'react';
import './Header.css';
import userIcon from '../assets'; // Update with correct path
import menuIcon from '../assets/menu-icon.png'; // Update with correct path

function Header() {
  return (
    <header className="header">
      <img src={menuIcon} alt="Menu Icon" className="menu-icon" />
      <h1 className="header-title">Marketing Content Validator</h1>
      <img src={userIcon} alt="User Icon" className="user-icon" />
    </header>
  );
}

export default Header;
